import Box from "@mui/material/Box";
import * as React from "react";

export default function AppDummy({ urlData }) {
	console.log(urlData);
	return (
		<>
			<Box
				style={{
					display: "flex",
					position: "relative",
					alignItems: "flex-end",
					paddingRight: "100px",
				}}
			>
				<Box>
					{urlData.map((elem) => (
						<li key={elem.url}>
							{" "}
							<span>
								{" "}
								{elem.count} - {elem.url}
							</span>
						</li>
					))}
				</Box>
			</Box>
		</>
	);
}
